import '../App.css';
import NavBar from '../NavBar';
import DoubleInput from '../formComponents/DoubleInput';
import Input from '../formComponents/Input';
import { useState } from 'react';

const Form = () => {
    const [formData, setFormData] = useState(
        {
            firstName: '',
            lastName: '',
            email: '',
            password: '',
            confirm: ''
        }
    );
    
    return(
        <div>
            <NavBar />
            <p className='welcome'>Make an Account!</p>
            <fieldset>
                <DoubleInput />
                <Input title={"School Email"} sample={"astronomy@stu.npenn.org"} name={"email"} type={"email"}/>
                <Input title={"Password"} sample={"abcd1234"} name={"password"} type={"password"}/>
                <Input title={"Confirm Password"} sample={"abcd1234"} name={"password"} type={"password"}/>
            </fieldset>
        </div>
    )
}

export default Form;
